def power(base, exp):
    if base == 0 and exp == 0:
        print("Indeterminate form (0^0)!")
        return None
    if exp < 0:
        print("Negative exponent, calculating reciprocal.")
        base = 1 / base
        exp = -exp
    result = 1
    for _ in range(exp):
        result *= base
    return result

