def find_primes(n):
    if n < 2:
        print("There are no primes less than 2.")
        return []
    primes = []
    for num in range(2, n + 1):
        is_prime = True
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            primes.append(num)
        else:
            if num == 4:
                print("4 is not a prime!")
    return primes

