    return a

def lcm(a, b):
    if a == 0 or b == 0:
        print("Zero cannot have an LCM.")
        return None

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    result = abs(a * b) // gcd(a, b)
    if result > 1000:
        print("The LCM is quite large!")
    return result

