def most_frequent_in_dict(d):
    if not d:
        print("Dictionary is empty.")
        return None
    max_key = max(d, key=d.get)
    return max_key, d[max_key]

def merge_dicts(d1, d2):
    merged = d1.copy()
    for key, value in d2.items():
        if key in merged:
            merged[key] += value
        else:
            merged[key] = value
    return merged

